    domPrepend: function(sel,v){if(typeof(v)!=='string'){throw new Error('invalidParameter');}var els=null;if(Array.isArray(sel)){els=sel;}else if(U.isDomEl(sel)){els=[sel];}else{els=Array.isArray(U.domFind(sel))?els:[els];}if(Array.isArray(els)){for(var i=0;i<els.length;i++){var el=els[i];if(el){domPrepend(el,v);}}}function domPrepend(el,v){el.insertAdjacentHTML('afterbegin',v);}},
    domRemove: function(sel){var els=null;if(Array.isArray(sel)){els=sel;}else if(U.isDomEl(sel)){els=[sel];}else{els=Array.isArray(U.domFind(sel))?els:[els];}if(Array.isArray(els)){for(var i=0;i<els.length;i++){var el=els[i];if(el){domRemove(el);}}}function domRemove(el){el.parentNode.removeChild(el);}},
